Notes:
Demand was played for the first time since December 31, 2009 (258 shows). Alumni Blues and Letter to Jimmy Page were played for the first time since August 3, 2013 (114 shows). Cry Baby Cry was played for the first time since November 21, 1998 (496 shows). Sing Monica was dedicated to producer Bob Ezrin. Walk Away was played for the first time since October 29, 2013 (100 shows). Sanity contained a brief vocal jam
